import React, { Component, useState, useEffect } from 'react';

//get patient schema


// Name, age, email, phone number, address, city, state, zipcode, sex
//Nine boxes for info
//Then 3 buttons for add, update, delete

class PatientForm extends Component {
    constructor(props) {
        super(props);
        const patient = {
            name: "",
            age: "",
            email: "",
            phoneNumber: "",
            address: "",
            city: "",
            state: "",
            zipCode: "",
            sex: ""
        }
    }


    clickHandler = () => {
        const [number, setNumber] = useState(0);
        setNumber(number+1);
    }


    render() {
        return(
            <div>
            <button>Add</button>
            <button onClick = {clickHandler}>{number}</button>
            <button>Delete</button>
            <button>Update</button>
            </div>
        )
    }
}

export default PatientForm;
